pragma solidity ^0.8.23;





contract GVault is IGVault, IMVersion { 

    string constant name = "G_VAULT";
    uint256 constant version = 2; 

    address constant NATIVE = 0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE;

    Gilt gilt; 
    IMRegister register; 
    address immutable self;
    bool expended = false; 
    bool committed = false; 

    constructor(address _register, Gilt memory _gilt) { 
        gilt = _gilt;
        register = IMRegister(_register);
        self = address(this); 
    }

    function getName() pure external returns (string memory _name) {
        return name; 
    }

    function getVersion() pure external returns (uint256 _version) {
        return version; 
    }

    function getGilt() view external returns (Gilt memory _gilt){
        return gilt; 
    }

    function getErc20() view external returns (address _erc20){
        return gilt.erc20; 
    }

    function getAmountStored() view external returns (uint256 _amount){
        return IERC20(gilt.erc20).balanceOf(self);
    }

    function storeFunds() external payable returns (bool _stored){
        require(!committed, "vault committed");
        committed = true; 
        if(gilt.erc20 == NATIVE) {
            require(msg.value >= gilt.amount, " NATIVE token transmission mis-match");
        }
        else {
            IERC20(gilt.erc20).transferFrom(msg.sender, self, gilt.amount);
        }
        return true; 
    }

    function releaseFunds() external returns(bool _empty){
        require(committed, "vault not committed");
        require(!expended, "vault expended");
        expended = true; 
        if(gilt.erc20 == NATIVE) {
            payable(msg.sender).transfer(self.balance);
        }
        else {
            IERC20(gilt.erc20).approve(msg.sender, gilt.amount);
        }
        return expended; 
    }

    function isCommitted() view external returns(bool _isCommitted){
        return committed; 
    }

    function isExpended() view external returns (bool _isExpended){
        return expended; 
    }   

}
// File: contracts/core/GVaultFactory.sol


pragma solidity ^0.8.23;




contract GVaultFactory is IGVaultFactory, IMVersion { 

    modifier giltContractOnly { 
        require(msg.sender == register.getAddress(GILT_CONTRACT_CA), "gilt contract only");
        _;
    }

    modifier adminOnly {
        require(msg.sender == register.getAddress(M_ADMIN_CA), "admin only");
        _;
    }

    string constant name = "RESERVED_G_VAULT_FACTORY";
    uint256 constant version = 2; 

    string constant GILT_CONTRACT_CA = "RESERVED_GILT_CONTRACT";
    string constant M_ADMIN_CA = "RESERVED_M_ADMIN";

    IMRegister register; 

    address [] vaults; 
    mapping(address=>bool) isKnownV;

    constructor(address _register) {
        register = IMRegister(_register);
    }

    function getName() pure external returns (string memory _name) {
        return name; 
    }

    function getVersion() pure external returns (uint256 _version) {
        return version; 
    }

    function getVaults() view external adminOnly returns (address [] memory _vaults) {
        return vaults; 
    }

    function isKnownVault(address _vault) view external returns (bool _isKnown) {
        return isKnownV[_vault];
    }

    function createVault(Gilt memory _gilt) external giltContractOnly returns (address _vault){
        _vault = address(new GVault(address(register), _gilt));
        vaults.push(_vault);
        isKnownV[_vault] = true; 
        return _vault; 
    }


}

